import React from "react";

import {CrecheSliderdata} from '../data';

import {Swiper, SwiperSlide} from 'swiper/react';

import 'swiper/css';
import 'swiper/css/pagination';
import '../slider.css';
import { Pagination } from "swiper";

 const CrecheSlider = () => { 
      return ( 
   <Swiper slidesPerView={auto} centeredSlides={true} spaceBetween={20} pagination={{clickable: true,}} modules={[Pagination]} className="MySwiper"> 
      { CrecheSliderdata.map((slide,index) => {
        const {image,name,Rating,Description}=slide;
        return (
            <SwiperSlide key={index} className="bg-white rounded border border-black xl:max-w-[645px] max-h-[330px] pt-[60px] px-[35px] xl:px-[70px] pb-[50px] flex items-start gap-x-[30px] shadow-xl">
                Slide
            </SwiperSlide>
        );
      })}

   </Swiper>
      );
      
 };

 export default CrecheSlider;
